import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter, Route, Link, IndexRoute, hashHistory, browserHistory } from 'react-router-dom'; /*new added */
import './index.css';
import 'bootstrap/dist/css/bootstrap.css'; /*new added */
import App from './App';
import * as serviceWorker from './serviceWorker'; /*what is this */

import Main from './App/Main'; /*new added */

// const container = document.querySelector('#app')

// const App = () => (
//   <BrowserRouter>
//     <Main />
//   </BrowserRouter>
// )
// ReactDOM.render( < App / > , container);
ReactDOM.render( < App / > , document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
